import React, {useEffect, useState} from "react";
import logo from './logo.svg';

export default function (props) {
    const [currentUserName, setCurrentUserName] = useState("default");
    const [currentUserUID, setCurrentUserUID] = useState("default");
    const [currentUserPassword, setCurrentUserPassword] = useState("default");

    useEffect(() => {
        fetch('session/').then(res => res.json().then(data => {
            setCurrentUserName(data[1].Username);
            setCurrentUserUID(data[1].UID)
            setCurrentUserPassword(data[1].Password)
        }))
    }, []);

    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo"/>
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <p>{currentUserName}</p>
                <p>{currentUserUID}</p>
                <p>{currentUserPassword}</p>
            </header>
        </div>
    )
}
